app.directive('typeahead', function($timeout) {
  return {
    restrict: 'AEC',
    scope: {
      items: '=',
      prompt: '@',
      name: '@',
      model: '=',
      onSelect: '='
    },
    link: function(scope, elem, attrs) {
      scope.handleSelection = function(selectedItem) {
        scope.model = selectedItem[scope.name];
        scope.current = 0;
        scope.selected = true;
        $timeout(function() {
          scope.onSelect(selectedItem);
        }, 200);
      };
      scope.current = 0;
      scope.selected = true;
      scope.isCurrent = function(index) {
        return scope.current == index;
      };

      scope.setCurrent = function(index) {
        scope.current = index;
      };
    },
    templateUrl: 'templates/typeahead.html'
  };
});

app.directive('cascadingGrid', function() {
  return {
    restrict: 'AEC',
    transclude: true,
    scope: {
      layoutOptions: '='
    },
    controller: function($scope, $element) {
      var addReload, initialized, reloading;
      $scope.layoutOptions.itemSelector = '.grid-element';
      initialized = false;
      reloading = false;
      addReload = function() {
        if (!reloading) {
          console.log("reloading")
          reloading = true;
          return $scope.$evalAsync(function() {
            $element.masonry('reloadItems');
            $element.masonry();
            return reloading = false;
          });
        }
      };
      
      this.addBrick = function(brick) {
          if (!initialized) {
            console.log("initializing");
            initialized = true;
            $element.masonry($scope.layoutOptions);
          }
          return addReload();
        };

      this.removeBrick = function() {
          return addReload();
        };
      }
    }
});



app.directive('gridElement', function() {
  return {
    restrict: 'C',
    require: "^cascadingGrid",
    link: function(scope, elem, attrs, cascadingGridCtrl) {
      console.log("executing")
      if (attrs.kxLoadEvent != null) {
        scope.$on(attrs.loadEvent, function() {});
        cascadingGridCtrl.addBrick(elem);
      }
      else {
        cascadingGridCtrl.addBrick(elem)
      }
      return scope.$on('$destroy', function() {
        return cascadingGridCtrl.removeBrick();
      });

    }  
  }
  
})
